	var currentCityIdToFind;
	var currentCityToFind;
	var nb_communes_trouvees = 0;
	var nb_tentatives = 0;

	var randomProperty = function (object) {
		var keys = Object.keys(object);
		return keys[Math.floor(keys.length * Math.random())];
	};

	function newQuestion(prev_id) {

		// first call from button to start to play
		if (prev_id == undefined) {
			// nothing to do

		}
	 	else {
	 		document.getElementById('message').innerHTML = "Trouve la commune bleue !"; // reset result message
	 		//reset the previous success to grey
	 		document.getElementById(prev_id).style.fill = 'grey';
	 	}

	 	console.log("C'est (re)tipar, on doit trouver");

	 	currentCityIdToFind = randomProperty(id_nom)
	 	console.log(currentCityIdToFind);
	 	currentCityToFind = id_nom[currentCityIdToFind];

	 	console.log(currentCityToFind);
	 	document.getElementById(currentCityIdToFind).style.fill = 'blue';
		 
	 };

 	function checkCity(obj) {
		if (tentative.value == currentCityToFind) {
		      // top
		    console.log("Bravo !");

		    document.getElementById(currentCityIdToFind).style.fill = 'green';
		    document.getElementById('message').innerHTML = "Bravo !";
		    setTimeout(function() {newQuestion(currentCityIdToFind);}, 2000);

		    nb_communes_trouvees += 1;

		    
		  }
		 else {
		 	console.log("Dommage");
		 	document.getElementById(currentCityIdToFind).style.fill = 'red';
		 	document.getElementById('message').innerHTML = "Raté, essaie encore !";
		 }

		 // reset anyway the text box
		 document.getElementById("tentative").value = "";

		 // update the statistics
		 nb_tentatives += 1;
		 // useful only once but nvm if we do it again and again
		 document.getElementById('decompte').style.display = "block";
		 document.getElementById('nb_tentatives_txt').innerHTML = nb_tentatives.toString();
		 document.getElementById('nb_communes_trouvees_txt').innerHTML = nb_communes_trouvees.toString();
		 
    }



</script>
